-- ----------------------------
-- View structure for AddressBook
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[AddressBook]') AND type IN ('V'))
	DROP VIEW [dbo].[AddressBook]
GO

CREATE VIEW [dbo].[AddressBook] AS select su2.SystemUserUUID,su2.IsDeleted ,su2.RealName,y.txlu from  SystemUser su2 
left join
(select SystemUserUUID,count(1) as txlu from (SELECT su.SystemUserUUID,su.RealName,c.ClientUUID,cl.CallTime,SUBSTRING (cl.CallTime, 0 , 10) as stime from SystemUser su 
inner join Customer c 
on su.SystemUserUUID =c.ClientManager
inner join ContactCallLog cl 
on c.ClientUUID =cl.ClientUUID 
--ORDER by cl.CallTime desc
where SUBSTRING (cl.CallTime, 0 , 11)=CONVERT(varchar(10),GETDATE(),120)
)x group by x.SystemUserUUID) y
on su2.SystemUserUUID =y.SystemUserUUID
GO

EXEC sp_addextendedproperty
'MS_Description', N'通讯录',
'SCHEMA', N'dbo',
'VIEW', N'AddressBook'
GO


