-- ----------------------------
-- View structure for ContactPersonView
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[ContactPersonView]') AND type IN ('V'))
	DROP VIEW [dbo].[ContactPersonView]
GO

CREATE VIEW [dbo].[ContactPersonView] AS SELECT 
cp.ID ,
cp.ContactName ,
cp.AddTime ,
cp.[Call] ,
cp.ContactPersonUUID ,
cp.Title ,
cp.Phone ,
cp.Cellphone ,
cp.Sex ,
cp.WeChat ,
cp.bgPhone ,
cp.zjPhone ,
cp.DateBirth ,
cp.TencentQQ ,
cp.OfficeAddress ,
cp.FamilyAddress ,
cp.Remarks ,
cp.IsDelete ,
su.RealName ,
c.ClientUUID ,
c.ClientName ,
c.ClientPhone ,
c.ClientManager as Manager ,
su2.RealName as ClientManager
from ContactPerson cp 
inner join SystemUser su 
on cp.SystemUserUUID =su.SystemUserUUID 
left join Customer c 
on cp.ClientUUID =c.ClientUUID 
left join SystemUser su2 
on c.ClientManager =su2.SystemUserUUID
GO


-- ----------------------------
-- View structure for ContactPList
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[ContactPList]') AND type IN ('V'))
	DROP VIEW [dbo].[ContactPList]
GO

CREATE VIEW [dbo].[ContactPList] AS SELECT 
cp.ID ,
cp.ContactPersonUUID ,
cp.IsDelete ,
c.ClientManager ,
(cp.ContactName+'('+c.ClientName +')') as ContactName
from ContactPerson cp 
inner join Customer c 
on cp.ClientUUID =c.ClientUUID
GO


-- ----------------------------
-- View structure for CustomerTree
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[CustomerTree]') AND type IN ('V'))
	DROP VIEW [dbo].[CustomerTree]
GO

CREATE VIEW [dbo].[CustomerTree] AS SELECT
c.ID ,
c.ClientUUID ,
c.ClientName ,
c.ClientManager ,
c.BusinessUUID ,
c.SystemUserUUID ,
c.SuperiorUUID ,
c.ClientArea ,
c.ClientBirthday ,
c.SuperiorMenu ,
c.IsDelete ,
su.RealName ,
cs.StatusName ,
ci.IndustryName ,
(select stuff((select ',' + cp.ContactName from ContactPerson cp  where cp.ClientUUID = c.ClientUUID and cp.IsDelete=0 for xml path('')),1,1,'')) as cpName ,
(SELECT COUNT(1) from Customer c2 where c2.ClientUUID=c.SuperiorUUID) as SpCount
from Customer c 
left join SystemUser su 
on c.ClientManager =su.SystemUserUUID 
left join CustomerStatus cs 
on c.ClientStatus =cs.CustomerStatusUUID 
left join CustomerIndustry ci 
on c.ClientIndustry =ci.IndustryUUID 
--where c.IsDelete =0
GO

EXEC sp_addextendedproperty
'MS_Description', N'客户树',
'SCHEMA', N'dbo',
'VIEW', N'CustomerTree'
GO


-- ----------------------------
-- View structure for View_Menu
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[View_Menu]') AND type IN ('V'))
	DROP VIEW [dbo].[View_Menu]
GO

CREATE VIEW [dbo].[View_Menu] AS SELECT   M.SystemMenuUUID, M.Name, M.Url, M.Alias, M.Icon, M.ParentGuid, M.ParentName, M.[Level], M.Description, M.Sort, 
                M.Status, M.IsDeleted, M.IsDefaultRouter, M.CreatedOn, M.CreatedByUserGuid, M.CreatedByUserName, M.ModifiedOn, 
                M.ModifiedByUserGuid, M.ModifiedByUserName, M.Component, M.HideInMenu, M.NotCache, M.BeforeCloseFun, 
                P.Type AS pt, P.Status AS ps, P.IsDeleted AS pd, RPM.SystemRoleUUID
FROM      dbo.SystemRolePermissionMapping AS RPM LEFT OUTER JOIN
                dbo.SystemPermission AS P ON P.SystemPermissionUUID = RPM.SystemPermissionUUID INNER JOIN
                dbo.SystemMenu AS M ON M.SystemMenuUUID = P.SystemMenuUUID
GO


