-- View structure for View_SystemPermissionWithMenu
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[View_SystemPermissionWithMenu]') AND type IN ('V'))
